id: GRAPHQL_DOS_DEFAULT_FIELD_OVERLOADING_ALIAS
info:
  name: "Denial of Service Test on GraphQL API with Default Field Overloading using Aliases"
  description: "This test is a security testing technique aimed at evaluating the resilience of GraphQL APIs against denial-of-service attacks. By overloading default fields with aliases, this method assesses the system's ability to handle large volumes of requests and identify potential vulnerabilities in query processing and resource allocation."
  details: "This technique aims to uncover potential weaknesses in query parsing, execution, and resource allocation, highlighting areas vulnerable to denial-of-service attacks. By analyzing the server's response and performance under such conditions, developers can better mitigate risks and strengthen their GraphQL resilience."
  impact: "The impact of this test can be severe. It could lead to service disruption or unresponsiveness, impacting user's ability to access the API's resources. Additionally, it may reveal vulnerabilities in query processing and resource allocation, potentially enabling attackers to exploit these weaknesses for malicious purposes. Proactively addressing these issues is crucial to maintaining the stability and security of the GraphQL API."
  category:
    name: RL
    shortName: Lack of Resources & Rate Limiting
    displayName: Lack of Resources & Rate Limiting (RL)
  subCategory: GRAPHQL_DOS_DEFAULT_FIELD_OVERLOADING_ALIAS
  severity: HIGH
  tags:
    - Business logic
    - OWASP top 10
    - HackerOne top 10
  references:
    - "https://github.com/OWASP/API-Security/blob/master/editions/2023/en/0xa4-unrestricted-resource-consumption.md"
  cwe:
    - CWE-400
  cve:
    - CVE-2023-4647
    - CVE-2023-38254

attributes:
  nature: INTRUSIVE
  plan: PRO
  duration: SLOW
compliance_standards: compliance/dos.conf
remediation: remediation/GRAPHQL_DOS_DEFAULT_FIELD_OVERLOADING_ALIAS.md
api_selection_filters:
  method:
    neq: "OPTIONS"
  url:
    regex: graphql
  response_payload:
    length:
      gt: 0
    not_contains:
      - error
      - issue
      - UserNotAuthorizedError
      - INTERNAL_SERVER_ERROR
      - "GRAPHQL_VALIDATION_FAILED"
      - "graphQL syntax error"
      - "Syntax Error: Expected Name, found <EOF>."
      - "GRAPHQL_PARSE_FAILED"
      - "Bad Request"

execute:
  type: multiple
  requests:
    - req:
        - add_header:
            dummyKey: dummyVal
        - validate:
            response_payload:
              percentage_match:
                gte: 90
        - success: x2
        - failure: exit

